  let styling = {
    backgroundColor: getComp1.bgcolor,
    padding: getComp1.padding + "px",
  };

  return (
    <div className="comp2" style={styling}>
      <a href={getComp1.link1}>Link 1</a>
      <a href={getComp1.link1}>Link 2</a>
      <a href={getComp1.link1}>Link 3</a>
    </div>
  );
}

export default Comp2;
